  surface, price} = house;
  return <div className='bg-white shadow-1 p-5 rounded-lg'>
    <img src={image}alt=''/>
    <div className=''>
      <div>{type}</div>
      <div>{country}</div>
      <div>{address}</div>
    </div>
  </div>;
};

export default House;
